import { gql } from '@apollo/client'

const REPO_DETAILS = gql`
  fragment RepoDetails on Repository {
    id
    ownerAvatarUrl
    description
    language
    stargazersCount
    reviewCount
    ratingAverage
    fullName
    forksCount
  }
`

export const GET_REPOSITORIES = gql`
	query Query {
    repositories {
      edges {
        node {
          ...RepoDetails
        }
      }
    }
	}
  ${REPO_DETAILS}
`

export const GET_ME = gql`
  query Query {
    me {
      username
    }
  }
`
